import React from "react";
import Head from "next/head";

export default function Code() {
  return (
    <React.Fragment>
      <head>
        <title>Code</title>
      </head>
      <h1>My Coding Adventure</h1>
      <h2>Getting Started</h2>
      <p>
        Here I will write about how I programmed this page if I find the time.
      </p>
    </React.Fragment>
  );
}
